import React, {Fragment} from 'react'
import PropTypes from 'prop-types'
import Moment from 'react-moment';
import { connect } from "react-redux";

function ListEducation(education) {

    console.log("Exp", education.education)
    // const experiences = <td></td>
    const educations = education.education.map(edu =>
        (
            <tr key={edu._id}>
                <td>{edu.school}</td>
                <td>{edu.degree}</td>
                <td>
                    <Moment format='YYYY/mm/dd'> edu.from </Moment> - {' '}{
                        edu.to === null ? ('Now'): (<Moment format='YYYY/mm/dd'> edu.from </Moment>)
                    }
                </td>
                <td><button className="btn btn-danger">Delete</button></td>
            </tr>
        )
        )

    return (
        <Fragment>
            <h2 className="my-2">Education Credentials</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>School</th>
                        <th className="hide-sm">degree</th>
                        <th className="hide-sm">Years</th>
                        <th> </th>
                    </tr>
                </thead>
                <tbody>
                    {educations}
                </tbody>
            </table>

        </Fragment>
    )
}

ListEducation.propTypes = {
    education: PropTypes.array.isRequired,
}

export default ListEducation;
